import React from "react";
import CollapsibleTable from "./CollapsibleTable";

const data = {
  key1: [
    (1, 2),
    (3, 4),
  ],
  key2: [
    (5, 6),
    (7, 8),
  ],
};

function App() {
  return (
    <div>
      <h1>Collapsible Table Example</h1>
      <CollapsibleTable data={data} />
    </div>
  );
}

export default App;
